import React, { useState} from "react";

function App() {
    const [formData, setFormData] = useState({
        id:"",
        firstName:"",
        lastName:"",
        amount

    });

    const handleValue = (e) => {
        setFormData({ ...formData, [e.target.name]: e.target.value });
    };

    const handleSubmit = async (e) => {
        e.preventDefault();
        try {
            const response = await fetch("/http://localhost:8080/result", {
                method: "GET",
                headers: {
                    "Content-Type": "application/json"
                },
                body: JSON.stringify(formData)
            });
            if (!response.ok) {
                throw new Error("Failed to submit data");
            }
            const responseData = await response.json();
            console.log("Server response:", responseData);
        } catch (error) {
            console.error("Error submitting data:", error);
        }

    };

    return (
        <div>
            <form onSubmit={handleSubmit}>
                <input type="text" name="id" value={formData.id} onChange={handleValue} placeholder="your id" /><br /><br />
                <input type="text" name="firstName" value={formData.firstName} onChange={handleValue} placeholder="your first name" /><br /><br />
                <input type="text" name="lastName" value={formData.lastName} onChange={handleValue} placeholder="your last name" /><br /><br />
                <input type="text" name="amount" value={formData.amount} onChange={handleValue} placeholder="your amount" /><br /><br />
                <input type="text" name="category" value={formData.category} onChange={handleValue} placeholder="your category" /><br /><br />
                <button type="submit">Submit</button>
            </form>
            <div>
            {formData.id}
            {formData.firstName}
            {formData.lastName}
            {formData.amount}
            {formData.category}
            </div>


        </div>

    );
}

export default App;
